import React, { Component } from "react";
import * as trademarkIcon from "../../Asset/trademark";
import mobiletrademark from "../../Common/constants/trademark";
import laptoptrademark from "../../Common/constants/laptop";
import { Route, Link, Switch } from "react-router-dom";

export default class index extends Component {
  mapTrademark = (type, mobiletrademark, laptoptrademark) => {
    let result = null;
    let trademark = null;
    switch (type) {
      case "mobile": trademark=mobiletrademark;
      case "laptop": trademark=laptoptrademark;
    };

    if (trademark.length) {
    result = trademark.map((value, index) => {
      return (
        <Link to={"/"+type+value} className="trademark-item">
          <img
            className="trademark-icon loaded"
            data-ll-status="loaded"

          ></img>
        </Link>
      );
      }
      );
    };
    return <Route>result</Route>
  };
  render() {
    return (
      mapTrademark(this.props.type, mobiletrademark, laptoptrademark)
    )
  }
}
